import React, { useEffect, useState } from "react";
import axios from "axios";

function App() {
  const [products, setProducts] = useState([]);
  const [cart, setCart] = useState([]);
  const [total, setTotal] = useState(0);
  const [loading, setLoading] = useState(true);

  // Fetch products from backend
  useEffect(() => {
    axios.get("http://localhost:5000/api/products")
      .then(res => {
        setProducts(res.data);
        setLoading(false);
      })
      .catch(err => console.log(err));
    fetchCart();
  }, []);

  const fetchCart = () => {
    axios.get("http://localhost:5000/api/cart").then(res => {
      setCart(res.data.cart);
      setTotal(res.data.total);
    });
  };

  const addToCart = (p) => {
    axios.post("http://localhost:5000/api/cart", {
      productId: p.id,
      qty: 1,
      name: p.title,
      price: p.price
    }).then(() => fetchCart());
  };

  const removeItem = (id) => {
    axios.delete(`http://localhost:5000/api/cart/${id}`).then(() => fetchCart());
  };

  const checkout = () => {
    axios.post("http://localhost:5000/api/checkout", { cartItems: cart })
      .then(res => {
        alert(`‚úÖ Checkout successful!\nTotal: $${res.data.total}`);
        fetchCart();
      });
  };

  return (
    <div style={styles.container}>
      <h1 style={styles.title}>üõçÔ∏è Vibe Commerce</h1>

      <h2 style={styles.subtitle}>Products</h2>

      {loading ? (
        <p>Loading products...</p>
      ) : (
        <div style={styles.grid}>
          {products.map(p => (
            <div key={p.id} style={styles.card}>
              <img src={p.image} alt={p.title} style={styles.image} />
              <h3 style={styles.name}>{p.title.length > 40 ? p.title.slice(0, 40) + "..." : p.title}</h3>
              <p style={styles.price}>${p.price}</p>
              <button style={styles.button} onClick={() => addToCart(p)}>Add to Cart</button>
            </div>
          ))}
        </div>
      )}

      <h2 style={styles.subtitle}>Cart</h2>
      {cart.length === 0 ? (
        <p>Your cart is empty üõí</p>
      ) : (
        <div style={styles.cart}>
          {cart.map(item => (
            <div key={item.productId} style={styles.cartItem}>
              <span>{item.name}</span>
              <span>x {item.qty}</span>
              <span>${(item.price * item.qty).toFixed(2)}</span>
              <button style={styles.removeBtn} onClick={() => removeItem(item.productId)}>Remove</button>
            </div>
          ))}
          <h3 style={styles.total}>Total: ${total.toFixed(2)}</h3>
          <button style={styles.checkoutBtn} onClick={checkout}>Checkout</button>
        </div>
      )}
    </div>
  );
}

// üíÖ Inline Styles for Simplicity
const styles = {
  container: {
    fontFamily: "'Inter', sans-serif",
    padding: "30px",
    maxWidth: "1100px",
    margin: "0 auto"
  },
  title: {
    fontSize: "2rem",
    fontWeight: "bold",
    marginBottom: "20px"
  },
  subtitle: {
    fontSize: "1.3rem",
    margin: "20px 0 10px"
  },
  grid: {
    display: "grid",
    gridTemplateColumns: "repeat(auto-fill, minmax(200px, 1fr))",
    gap: "20px"
  },
  card: {
    border: "1px solid #ddd",
    borderRadius: "12px",
    padding: "15px",
    textAlign: "center",
    boxShadow: "0 2px 5px rgba(0,0,0,0.1)",
    transition: "transform 0.2s ease",
  },
  image: {
    width: "100%",
    height: "180px",
    objectFit: "contain",
  },
  name: {
    fontSize: "1rem",
    margin: "10px 0",
    color: "#333"
  },
  price: {
    fontWeight: "bold",
    color: "#007b5e"
  },
  button: {
    background: "#007b5e",
    color: "white",
    padding: "8px 12px",
    border: "none",
    borderRadius: "8px",
    cursor: "pointer",
    marginTop: "8px"
  },
  buttonHover: {
    background: "#005f48"
  },
  cart: {
    borderTop: "2px solid #ddd",
    marginTop: "15px",
    paddingTop: "10px"
  },
  cartItem: {
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
    marginBottom: "10px"
  },
  removeBtn: {
    background: "#dc3545",
    color: "white",
    border: "none",
    borderRadius: "5px",
    padding: "5px 10px",
    cursor: "pointer"
  },
  checkoutBtn: {
    background: "#28a745",
    color: "white",
    border: "none",
    borderRadius: "8px",
    padding: "10px 15px",
    fontSize: "1rem",
    cursor: "pointer",
    marginTop: "10px"
  },
  total: {
    fontSize: "1.2rem",
    marginTop: "10px"
  }
};

export default App;
